import React from 'react';
import './App.css';
import SearchBox from '../search-box/SearchBox';
import Home from '../home/Home';

function App() {
  return (
    <d className="App">
      <header className="App-header">
        <SearchBox />
      </header>
      <Home />
    </d>
  );
}

export default App;
